import React from "react"
import Header from './components/Header'
import Image from "./components/Image"
import ATrain from './img/ATrain.jpg'

class Registration extends React.Component {
constructor() {
  super(props)
  
}

  text = "Введите имя"
  render() {
    return <div>
    <Header title="Тест Название"/>
    <h1>{this.text}</h1>
      <input placeholder={this.text}></input>
      {/* <Image image={ATrain}/> */}
  </div>
  }

  inputClick () {
    this.text = "Changed"
    console.log("Clicked")
  }
}

export default Registration
